import React from 'react'
import homepic from '../assets/homepic.png'
function Home() {

    const hometext = {
        fontFamily: 'ITC Franklin Gothic LT', 
        fontSize: '55px', 
        marginTop: '180px',
        marginLeft:'150px',
        whiteSpace: 'pre-line', // Allow line breaks
        fontWeight:'bold'
    };
    const homepicture = {
        width: '500px', // Adjust the width of the image
        height: 'auto', // Maintain aspect ratio
        border: '5px #63821b', // Border color and thickness
        borderRadius: '25%,10%', // Border radius
        marginTop: '50px', // Adjust the top margin
    }
  return (
    <div className="home">
        <div style = {hometext}>Changing the Face of {'\n'}Irish Food Education</div>
        <div><img src={homepic} alt="homepic" style={homepicture} /></div>
    </div>

  )
}

export default Home
